import React from "react";

class Home extends React.Component {
  constructor() {
    super();
  }
  render() {
    let { data } = this.props;
    return (
      <>
        <h1>I am Home component </h1>
        <hr />
        {data &&
          data.map((eachItem, index) => {
            return (
              <div key={index}>
                <Card item={eachItem} />
              </div>
            );
          })}
      </>
    );
  }
}
class Card extends React.Component {
  constructor() {
    super();
  }
  render() {
    return (
      <div key={this.props.item.id}>
        <h1>{this.props.item.name}</h1>
      </div>
    );
  }
}
export default Home;
